/** 
 * Closes a <code>AutoCloseable</code> unconditionally. <p> Equivalent to  {@link ResultSet#close()}, except any exceptions will be ignored. This is typically used in finally blocks. <p> Example code: <p> <pre> AutoCloseable statement = null; try { statement = new Connection(); // process close statement.close(); } catch (Exception e) { // error handling } finally { IOUtils.closeQuietly(conn); } </pre>
 * @param resultSet the Connection to close, may be null or already closed
 * @since 2.2
 */
public static void closeQuietly(final ResultSet resultSet){
  if (resultSet != null) {
    try {
      resultSet.close();
    }
 catch (    Exception e) {
      logger.error("error close resultSet",e);
    }
  }
}

